filterBackSlash :: String -> String
filterBackSlash = foldr func []
    where
        func :: Char -> String -> String
        func c str
            | c == '\\' = case head str of
                'a' -> '\a' : tail str
                'b' -> '\b' : tail str
                'f' -> '\f' : tail str
                'n' -> '\n' : tail str
                'r' -> '\r' : tail str
                't' -> '\t' : tail str
                'v' -> '\v' : tail str
            | otherwise = c : str


